com","https://www.isoenergy.ca","https://www.uraniumroyalty.com","https://www.madergroup.com.au","https://www.wlm.com.br","https://www.petrusresources.com","https://www.verallia.com","https://www.pilbaraminerals.com.au","https://www.premierhealthgroup.ca","https://www.aavas.in","https://www.powerhouse-ventures.co.nz","https://www.acelon.com.tw","https://www.atoss.com","https://adapthealth.com","https://www.frenckengroup.com","https://www.nayax.com","https://www.bloomenergy.com","https://www.eqt.com","https://www.novocure.com","https://www.aavas.in","https://www.tialis.com"],"shape":[50],"dtype":"object","order":"little"}],["description",{"type":"ndarray","array":["PT Ladang Baja Murni Tbk distributes steel products and derivatives in Indonesia. The company trades in various steel products, including rule die steel, steel, copper, het lock, and cutting rule products, as well as spare parts. It also produces finish plates, mold base, and custom mold products. The company was founded in 1989 and is headquartered in Bekasi, Indonesia. PT Ladang Baja Murni Tbk is a subsidiary of PT Adyatama Global Investama.","EOH Holdings Limited provides information and communications technology services in South Africa, rest of Africa, Europe, and the Middle East. The company offers industry consulting, information technology services, systems integration, software, industrial technologies, and business process outsourcing services. Its services include go-to-market solutions, network solutions, manage and operate digital industries, knowledge process outsourcing, computer software and hardware reselling, enterprise applications, application development, data analysis, cloud and security, and automation solutions. The company also offers infrastructure solutions; information services; rapid application development platform that allows the agile enterprise to build, model, and deploy multi-experience apps; and systems and services for the administration of cities. EOH Holdings Limited was incorporated in 1998 and is based in Bedfordview, South Africa.","PT Kurniamitra Duta Sentosa, Tbk operates as a food and beverage industry in Indonesia. It trades, distributes, and sells syrups, fruit mixes, frappe products, and gourmet sauces; coffee products; almond milk, soy milk, coconut milk, dairy milk, and free lactose milk products; and coffee makers. The company was founded in 2000 and is headquartered in Tangerang Selatan, Indonesia. PT Kurniamitra Duta Sentosa, Tbk is a subsidiary of PT Miki Ojisan Indomitra.","5paisa Capital Limited provides an online technology platform for trading in National Stock Exchange of India Limited, BSE Limited, and MCX. The company offers financial services, including online discounted stock broking, depository services; distributes mutual funds, bonds, and debentures, as well as insurance products; and provides equity and mutual fund research, investment advisory services, etc. It provides peer-to-peer lending services through its platform 5paisa and mobile app 5Paisa Loans. In addition, the company offers its services through a web-based trading terminal, mobile application, and a state of the art call and trade unit. It serves retail investors and high-volume traders. 5paisa Capital Limited was incorporated in 2007 and is headquartered in Thane, India.","CSP Steel Center Public Company Limited manufactures and distributes steel products in Thailand. It offers steel sheets, such as master coil, cutting sheet, slitting coil, and tolling for processing steel. The company also provides hot-rolled and cold-rolled steel sheets and pipes; and specializes in customizing steel sheets to other shapes. It serves clients in the automobiles, home and electric appliances, steel furniture, general usage, and structure and construction industries. The company was formerly known as CSP Trading Company Limited and changed its name to CSP Steel Center Public Company Limited in July 2005. CSP Steel Center Public Company Limited was founded in 1992 and is headquartered in Bangkok, Thailand.","M-tron Industries, Inc. designs, manufactures, and markets frequency and spectrum control products. It operates in two product groups, Frequency Control and Spectrum Control. The Frequency Control product group includes a portfolio of quartz crystal resonators, clock oscillators, VCXO, TCXO OCXO, and DOCXO devices. These products are designed for applications in aerospace and defense, telecommunications infrastructure, and instrumentation markets. The Spectrum Control product group comprises an array of radio frequency (RF), microwave and millimeter wave filters, and diplexers covering a frequency range from 1 MHz to 90 GHz, and solid-state power amplifiers covering a frequency range from 300 MHz to 26 GHz, with power output from 10 Watts to 10 kWatts. The filter devices include crystal, ceramic, LC, tubular, combline, cavity, interdigital and metal insert waveguide, as well as digital, analog, and mechanical tunable filters, switched filter arrays, and RF subsystems. The power amplifiers add active devices comprise GaN, GaAS FET, LDMOS, and chip and wire technologies in narrow or broadband, module, or rack-mounted packages. These products are used in applications in the commercial and military aerospace, defense, space, and other commercial markets. The company was founded in 1965 and is based in Orlando, Florida.","TXO Energy Partners, L.P. engages in the acquisition, development, optimization, and exploitation of conventional oil, natural gas, and natural gas liquid reserves in North America. As of July 31, 2022, it had working interest in the 850,009 gross acres located in the United States primarily in the San Juan Basin of New Mexico and Colorado, and the Permian Basin of West Texas and New Mexico. The company was founded in 2012 and is based in Fort Worth, Texas.","Optron-Tec Inc manufactures and sells optical lenses and module based glass, filter for image sensor, and optical pickup filter. Optical technology is widely used in IT, medical devices and among others.","Iguatemi S.A., together with its subsidiaries, operates shopping centers in Brazil. It designs, plans, develops, and manages shopping malls, outlets, and mixed-use real estate complexes, as well as office towers. The company operates a network of 14 shopping centers, 2 outlet stores, and 3 office towers with a total gross leased area of approximately 711,000 square meters. In addition, it provides economic, financial, tax advisory, and consulting services. The company was formerly known as Jereissati Participa\u00e7\u00f5es S.A. and changed its name to Iguatemi S.A. in November 2021. The company was founded in 1946 and is headquartered in S\u00e3o Paulo, Brazil.","Victorian Plumbing Group plc operates as an online retailer of bathroom products and accessories. It offers a range of products to B2C and trade customers with approximately 125 brands, as well as designs and develops in-house products. The company's bathroom product lines include tiles, flooring, and lighting. Victorian Plumbing Group plc was incorporated in 2021 and is based in Skelmersdale, United Kingdom.","South Star Battery Metals Corp. engages in the exploration and development of mineral properties in Brazil. It is developing the Santa-Cruz Graphite project that consists of 13 licenses covering an area of approximately 13,316 hectares located in Bahia State, Brazil. The company was formerly known as South Star Mining Corp. and changed its name to South Star Battery Metals Corp. in May 2021. South Star Battery Metals Corp. was incorporated in 1984 and is headquartered in Vancouver, Canada.","PT Sumber Global Energy Tbk, together with its subsidiaries, engages in coal trading and shipment services in Indonesia. The company engages in the wholesale of solid, liquid, gas, and renewable energy; and mining of rare earth metals and minerals. It also engages in the hotel, agency, and contracting businesses, as well as provision of other supporting mining activities. In addition, it offers transportation and warehousing services. It serves companies operating in the energy sector. The company was founded in 2008 and is headquartered in South Jakarta, Indonesia. PT Sumber Global Energy Tbk is a subsidiary of PT Sumbermas Inti Energi.","Globus Maritime Limited, an integrated dry bulk shipping company, provides marine transportation services worldwide. It owns, operates, and manages a fleet of dry bulk vessels that transport iron ore, coal, grain, steel products, cement, alumina, and other dry bulk cargoes. As of March 31, 2022, the company's fleet included nine vessels with a total carrying capacity of 626,257 deadweight tonnage. It charters its vessels to operators, trading houses, shipping companies and producers, and government-owned entities. The company was incorporated in 2006 and is based in Athens, Greece. Globus Maritime Limited is a subsidiary of Firment Trading Limited.","Promimic AB (publ) manufactures, markets, and sells biomaterials for improved osseointegration for orthopedic and dental implants markets. It offers HAnano surface technology that combines various properties that are known to improve osseointegration into one unique surface modification. The company was incorporated in 2004 and is headquartered in M\u00f6lndal, Sweden.","Tocvan is a well-structured exploration development company. Tocvan was created in order to take advantage of the prolonged downturn the junior mining exploration sector, by identifying and negotiating interest in opportunities where management feels they can build upon previous success. Tocvan has approximately 32 million shares outstanding and is earning 100% into two exciting opportunities in Sonora, Mexico: the Pilar Gold-Silver project and the El Picacho Gold-Silver project. Management feels both projects represent tremendous opportunity to create shareholder value.","Garrett Motion Inc., together with its subsidiaries, designs, manufactures, and sells turbocharger and electric-boosting technologies for light and commercial vehicle original equipment manufacturers worldwide. The company offers light vehicle gasoline and diesel, and commercial vehicle turbochargers; and provides automotive software solutions. It offers its products in the aftermarket through distributors. Garrett Motion Inc. was incorporated in 2018 and is headquartered in Rolle, Switzerland.","Future Health ESG Corp. does not have significant operations. The company focuses on effecting a merger, capital stock exchange, asset acquisition, stock purchase, reorganization, or similar business combination with one or more businesses. It intends to pursue an initial business combination opportunity in the smart health technology sector. The company was incorporated in 2021 and is based in Dover, Delaware.","Gravity Co., Ltd. develops and publishes online and mobile games in South Korea, Taiwan, Thailand, and Japan. The company offers a massively multiplayer online role-playing game, including Ragnarok Online, Dragonica, Ragnarok Online II, and Ragnarok Prequel II. Its mobile games portfolio includes Ragnarok M: Eternal Love; Ragnarok Origin; Ragnarok X: Next Generation; the Labyrinth of Ragnarok; Ragnarok Poring Merge; Tera Classic; Ragnarok: The Lost Memories; Sadako M; NBA: Rise To Stardom; Milkmaid Of The Milky Way; and Paladog Tactics. The company also provides console games, such as Ragnarok DS for Nintendo DS; Ragnarok: The Princess of Light and Darkness for PlayStation Portable; Ragnarok Odyssey for PlayStation Vita; Double Dragon II for Xbox 360; Ragnarok Odyssey Ace for PlayStation Vita and PlayStation 3; and GRANDIA HD Collection for Nintendo Switch. In addition, it offers games for IPTV, including Pororo: The Little Penguin; and markets dolls, stationery, food, and other character-based merchandises, as well as game manuals, monthly magazines, and other publications. Further, the company provides system development and maintenance services, as well as system integration services to third parties. As of December 31, 2021, it owned 156 registered domain names. The company was incorporated in 2000 and is headquartered in Seoul, South Korea. Gravity Co., Ltd. is a subsidiary of GungHo Online Entertainment, Inc.","Enphase Energy, Inc., together with its subsidiaries, designs, develops, manufactures, and sells home energy solutions for the solar photovoltaic industry in the United States and internationally. The company offers semiconductor-based microinverter, which converts energy at the individual solar module level, and combines with its proprietary networking and software technologies to provide energy monitoring and control services. It also offers AC battery storage systems; Envoy communications gateway; and Enlighten cloud-based monitoring service, as well as other accessories. The company sells its solutions to solar distributors; and directly to large installers, original equipment manufacturers, strategic partners, and homeowners, as well as through its legacy product upgrade program or online store. Enphase Energy, Inc. was incorporated in 2006 and is headquartered in Fremont, California.","Power Metal Resources plc, together with its subsidiaries, engages in the exploration and development of mineral properties in North America, Australia, and Africa. It primarily explores for cobalt, lithium, copper, nickel, gold, rare earth elements, and platinum group metals. The company holds 70% interest in the Kisinka project situated in the Democratic Republic of the Congo; and 30% interest in the Silver Peak project located in British Columbia, as well as owns an interest in projects located in Botswana and Tanzania. It also has an option to acquire 100% interest in the Magical property and Enable property located on the Schreiber-Hemlo Greenstone Belt in north-western Ontario, Canada; 51% interest in the Ditau Camp project situated in Botswana; and 75% interest in the alamo gold project located in west-central Arizona, the United States. In addition, the company holds 50.8% interest in the Molopo Farms Complex project, a nickel sulphide and platinum-group element mineralization deposit in Botswana. The company was formerly known as African Battery Metals Plc and changed its name to Power Metal Resources plc in June 2019. Power Metal Resources plc was incorporated in 2011 and is based in London, the United Kingdom.","Norwegian Energy Company ASA, an oil and gas company, focuses on the exploration, development, and production of hydrocarbon resources in Norway, Denmark, the Netherlands, and the United Kingdom. Its asset portfolio includes four production hubs and 11 producing fields on the Danish Continental Shelf. As of December 31, 2021, the company had proven and probable reserves of 9.8 million barrels of oil equivalent. Norwegian Energy Company ASA was founded in 2005 and is headquartered in Oslo, Norway.","MRS Log\u00edstica S.A. is a logistics operator that manages a rail network in Brazil. It transports containers; cement; bauxite; agricultural; coke; coal; iron ore; and steel products, such as iron ore, coal, and coke. The company was founded in 1996 and is based in Rio de Janeiro, Brazil.","Delta Galil Industries Ltd. engages in the design, development, production, marketing, and sale of men and women apparel products worldwide. It operates through Brands, Private Label, Delta Israel, Seven for All Mankind, and other segments. The Brands segment operates brands, such as Schiesser, Eminence, Splendid, PJ Salvage, and company licensed brands comprising Columbia, Tommy Hilfiger, and Polo Ralph Lauren, Adidas, Wolford, and others, in underwear , leisure wear, and sleep wear categories. The Private Label segment operates private labels in category of underwear, leisure wear, and sleep wear under Nike, Victoria's Secret, Walmart, Target, and other brands. The Delta Israel segment design, develop, and markets branded undergarments for women and men, sleepwear, socks, children clothing products under Delta and Fix brands and distributes through stores in Israel and websites, as well as retails and wholesales its products. The Seven for All Mankind segment operates clothing in the Denim category for women, men, and children. The Other segment operates Bare Necessities and Organic Basics brands. Delta Galil Industries Ltd. was incorporated in 1975 and is headquartered in Caesarea, Israel.","Thor Explorations Ltd., a natural resources company, engages in the acquisition, exploration, development, and production of mineral properties in Senegal, Burkina Faso, Nigeria, and Canada. The company primarily explores for gold and silver deposits. Its flagship property is the Segilola gold project located in Osun State, Nigeria. The company was incorporated in 1968 and is based in Vancouver, Canada.","CONSOL Energy Inc. produces and exports bituminous coal in the United States. It operates through PAMC, CONSOL Marine Terminal, and Other segments. The company engages in the mining, preparation, and marketing of bituminous coal to power generators, industrial end-users, and metallurgical end-users; and provision of coal export terminal services, as well as development of the Itmann Mine and the Greenfield reserves. It owns and operates the Pennsylvania Mining Complex (PAMC), which includes the Bailey Mine, the Enlow Fork Mine, the Harvey Mine, and the Central Preparation Plant; and CONSOL Marine Terminal located in the port of Baltimore. As of December 31, 2021, the company had 612.1 million tons of proven and probable coal reserves at PAMC. It also owns approximately 1.4 billion tons of Greenfield reserves located in the Northern Appalachian, Central Appalachian, and Illinois basins. The company was founded in 1860 and is headquartered in Canonsburg, Pennsylvania.","Enlight Renewable Energy Ltd operates as a renewable energy platform in Israel and internationally. The company initiates, plans, develops, constructs, and operates projects to produce electricity from renewable energy sources. It develops wind energy and solar energy projects, as well as energy storage projects. The company was incorporated in 1981 and is headquartered in Rosh HaAyin, Israel.","Adani Energy Solutions Limited, together with its subsidiaries, generates, transmits, and distributes power in India. The company operates through Transmission, Trading, and GTD Business segments. It establishes, commissions, operates, and maintains electric power transmission systems. The company is involved in the dealing of bullion and agro commodities; and laying of optical ground wire fibers on transmission lines to provide telecom solutions to telecom companies, internet service providers, and long-distance communication operators. The company was formerly known as Adani Transmission Limited and changed its name to Adani Energy Solutions Limited in July 2023. The company was founded in 2006 and is headquartered in Ahmedabad, India. Adani Energy Solutions Limited is a subsidiary of S.B. Adani Family Trust.","Hi-Tech Pipes Limited manufactures and sells steel products for infrastructure, constructions, automobiles, energy, agriculture, defense, engineering, and telecom industries in India. It offers ERW black steel pipes and tubes used in fencing, line pipes, scaffolding, water and gas conveyance, oil country tubular, hand pumps, collieries, thermal powers, telecom, automobiles, and agriculture sector; rectangular and hollow sections; galvanized and pre-galvanized steel pipes and tubes; metal beam crash barriers for applications, such as national highways, expressways, bridges and flyovers, embankments, mines, collieries, high density fast moving traffic areas in cities, motor racing/test drove tracks, village areas along highways, crash test sites, factory areas, traffic safety in airports, plants handling hazardous chemicals, and multi-story parking lots. The company also provides cold rolled sheets and strips used in precision tubes, containers, bicycles, furniture, color coating, galvanizing and tinning, and automobile industry to produce car body panels; and cold formed sections, as well as solar mounting structures and various other galvanized products. It operates through a network of approximately 200 distributors and 300 dealers. Hi-Tech Pipes Limited also exports its products. The company was formerly known as Ram Lal Harbans Lal Limited and changed its name to Hi-Tech Pipes Limited in October 1986. Hi-Tech Pipes Limited was incorporated in 1985 and is headquartered in New Delhi, India.","Nang Kuang Pharmaceutical Co., Ltd. operates as a pharmaceutical company primarily in Taiwan. The company provides parenterals, aseptic parenterals, lyophilized injections, pre-filled syringes, and pre-mixed IV infusion bags, as well as tablets, capsules, topical products, and oral suspensions. It offers various products in the areas of cardiovascular system, gastrointestinal system, nervous system, alimentary and metabolism, blood, antineoplastic and immunomodulatory, musculo-skeletal system, respiratory system, dermatological, genito-urinary and sex hormone, systemic hormone, systemic antibacterial, and cosmetics, as well as hospital solution. In addition, the company offers sterile, anticancer injectable, injectable controlled and oral controlled products, and oral disintegration tablets. Nang Kuang Pharmaceutical Co., Ltd. was founded in 1963 and is headquartered in Tainan City, Taiwan.","Dorel Industries Inc. designs, manufactures, sources, markets, and distributes home products and juvenile products worldwide. The company's Dorel Home segment engages in the design, manufacture, sourcing, and distribution of ready-to assemble furniture and home furnishings products, folding chair and tables, outdoor and juvenile furniture, futons, bunk beds, mattresses, bedroom, dining, home entertainment, and office furniture, upholstery, step stools and ladders, and hand trucks. This segment markets its products under the Ameriwood, Altra, System Build, Ridgewood, DHP, Dorel Fine Furniture, Dorel Living, Signature Sleep, Cosmo Living, Novagratz, Little Seeds, Queer Eye, Cosco, and Alphason brands. Its Dorel Juvenile segment manufactures and distributes infant car seats, strollers, travel systems high chairs, play yards, safety aids, swings/toys, early learning/infant health, mobiles, baby toys, playpens, and developmental toys under the Maxi-Cosi, Quinny, Tiny Love, Safety 1st, BebeConfort, Cosco, Mother's Choice, Disney, and Infanti brands. The company sells its products to mass merchant discount chains, department stores, club format outlets, and hardware/home centers; Internet retailers; independent boutiques and juvenile specialty stores; and sporting goods stores. It also owns and operates approximately 88 retail stores in Chile and Peru, as well as various factory outlet retail locations in Europe. The company was formerly known as Dorel Co. Ltd. and changed its name to Dorel Industries Inc. in May 1987. Dorel Industries Inc. was incorporated in 1962 and is headquartered in Westmount, Canada.","IsoEnergy Ltd. engages in the acquisition, development, evaluation, and exploration of uranium mineral properties. It primarily holds interest in the Larocque East, Geiger, Thorburn Lake, Radio, Hawk, Ranger, and Collins Bay Extension properties in the Athabasca Basin of Saskatchewan, Canada, as well as interests in various other properties. The company was incorporated in 2016 and is headquartered in Saskatoon, Canada. IsoEnergy Ltd. is a subsidiary of NexGen Energy Ltd.","Uranium Royalty Corp. operates as a pure-play uranium royalty company. It acquires, accumulates, and manages a portfolio of geographically diversified uranium interests. The company has royalty interests in the McArthur River, Cigar Lake / Waterbury Lake, Roughrider, Russell Lake, Russell Lake south, and Dawn Lake projects in Saskatchewan, Canada; Anderson and Workman Creek projects in Arizona; Lance and Reno Creek projects in Wyoming; Church Rock and Roca Honda projects in New Mexico; Dewey-Burdock project in South Dakota; Slick Rock project in Colorado; Langer Heinrich project in Namibia; and Michelin project in Newfoundland and Labrador, Canada. The company was incorporated in 2017 and is headquartered in Vancouver, Canada.","Mader Group Limited, a contracting company, provides specialized technical services in the mining, energy, and industrial sectors in Australia and internationally. It offers rail services, digger and drill support team, fabrication and line boring, non-processing and processing infrastructure, power generation and marine, field support, professional support roles, maintenance projects, electrical services, component exchange, rapid response teams, rostered support, HME shutdown teams, specialized tool hire, clean team, trade upgrade program, training national workforces, and maintenance centre services. The company also provides in-field technical support, major overhauls and repairs, preventative equipment maintenance, training of maintenance teams, and ancillary services. Mader Group Limited was founded in 2005 and is headquartered in Perth, Australia.","WLM Participa\u00e7\u00f5es e Com\u00e9rcio de M\u00e1quinas e Ve\u00edculos S.A. engages in the marketing and sale of heavy trucks, road and urban bus chassis, and spare parts under the Scania brand in Brazil. The company also provides maintenance services and specialized technical assistance. In addition, it engages in the production, breeding, and commercialization of beef cattle; and cultivation and commercialization of grains. The company was formerly known as WLM Ind\u00fastria e Com\u00e9rcio S.A. and changed its name to WLM Participa\u00e7\u00f5es e Com\u00e9rcio de M\u00e1quinas e Ve\u00edculos S.A. in December 2017. The company was founded in 1946 and is headquartered in Rio de Janeiro, Brazil. WLM Participa\u00e7\u00f5es e Com\u00e9rcio de M\u00e1quinas e Ve\u00edculos S.A. is a subsidiary of Sajuth\u00e1-Rio Participa\u00e7\u00f5es S.A.","Petrus Resources Ltd., an energy company, engages in the acquisition, exploration, development, and exploitation of oil and gas development assets in western Canada. The company focuses on risk-managed exploration. It primarily explores for natural gas, natural gas liquids, and crude oil and condensate. In addition, the company primarily holds an average 51% working interest in the Ferrier/Strachan area comprise 43,159 net acres, which include 29,219 net acres of undeveloped and 13,940 net acres of developed land located in west central Alberta near the town of Rocky Mountain House, Alberta. Further, it holds an average of 64% working interest in the Thorsby/Pembina area consisting of 69,042 net acres of land covering 22,135 net acres of undeveloped land and 46,907 net acres of developed land located in the southwest of Edmonton, Alberta; and an average of 50% working interest in the Foothills area that consists of 30,748 net acres of undeveloped land and 6,687 net acres of developed land located northwest of Rocky Mountain House, Alberta. Petrus Resources Ltd. was incorporated in 2015 and is headquartered in Calgary, Canada.","Verallia Soci\u00e9t\u00e9 Anonyme produces and sells glass packaging products for beverages and food industry worldwide. It provides bottles and jars for still and sparkling wines, spirits, food products, beers, soft drinks, and mineral water. The company was founded in 1827 and is headquartered in Courbevoie, France.","Pilbara Minerals Limited explores for, develops, and operates mineral resources in Australia. The company primarily holds a 100% interest in the Pilgangoora lithium-tantalum project located in the Pilbara region of Western Australia. The company was incorporated in 2005 and is based in West Perth, Australia.","Premier Health of America Inc., a specialized healthcare services company, provides staffing and outsourced service solutions for healthcare needs in Canada. It also offers health consulting, nursing, and health-care services in remote communities, as well as medical transport services; and Code Bleu, an agency to employ nurses, caregivers, dental staff, and other health-related personnel. The company provides its services through PSweb, a CRM platform. It serves governments, corporations, individuals, public and private hospitals, medical clinics, and retirement homes. The company was founded in 2003 and is headquartered in Blainville, Canada.","Aavas Financiers Limited provides housing loans to customers belonging to low- and middle-income self-employed customers in semi-urban and rural areas in India. It offers home loans for flats, houses, and bungalows, as well as resale properties; land purchase and construction loans, including finance for self-construction of residential house; and home improvement loans, including loans for tiling or flooring, plaster, painting, etc. The company also provides home equity loans; and micro, small, and medium enterprise loans for business expansion, purchase of equipment, working capital, etc., as well as home loan balance transfer, and emergency credit line guarantee scheme products. The company was formerly known as AU Housing Finance Limited and changed its name to Aavas Financiers Limited in May 2017. Aavas Financiers Limited was incorporated in 2011 and is based in Jaipur, India.","Powerhouse Ventures Limited is a venture capital firm specializing in incubation, start-up, early stage, and growth capital investments. The firm primarily makes investments in companies from Canterbury, New Zealand. It seeks to invest in engineering and clean technology; biotechnology and agri-science; health and medical devices; food; and information technology, software, and electronics. The firm also makes investments in intellectual property and research. It typically invests in companies that do not seek to raise more than NZD 5 million (USD 4.28 million) and with the aggregate of capital and reserves of, and loans made by shareholders not exceeding NZD 10 million (USD 8.57 million). Powerhouse Ventures Limited was founded in 2006 and is based in Christchurch, New Zealand with offices in Wellington, New Zealand, Dunedin, New Zealand and Auckland, New Zealand.","Acelon Chemicals &amp; Fiber Corporation manufactures and sells textile products worldwide. It offers filament yarns, including nylon, nylon/polyester conjugate, m\u00e9lange, and polyester yarns; functional yarns, such as cooling, antistatic, moisture wicking, antibacterial, thermal, and abrasion resistant nylon yarns; and ECO friendly yarns, including bio based nylon, dope dyed, abrasion resistant nylon, recycled dope dyed color, and recycled polyester and nylon yarns. The company provides its products under AcePaleta, AceIce, AceStatic, AceCool, AceHygeia, AceVitality, DuraXtend, AceEcobio, AceColor, AceColor ECO, and AceECO brands. Its products are used in various end markets, such as ready-made garments, outdoor functional products, household goods, industrial products, etc. The company was founded in 1988 and is based in Changhua, Taiwan.","ATOSS Software AG, together with its subsidiaries, develops and sells workforce management software in Germany, Austria, Switzerland, and internationally. The company's solutions include Crewmeister; ATOSS Time Control, a software solution for time and attendance management, and workforce scheduling for small to medium-sized customers, as well as large decentralized organizations; and ATOSS Staff Efficiency Suite is multi-client for large-scale companies and international corporations for comprehensive time and attendance management, resource planning, and demand planning. In addition, the company offers software implementation and training services; and sells software licenses. It serves customers in the manufacturing and production, healthcare and social services, retail and chain stores, hospitality, logistics and transportation, and service industries. ATOSS Software AG was founded in 1987 and is headquartered in Munich, Germany.","AdaptHealth Corp., together with its subsidiaries, provides home medical equipment (HME), medical supplies, and home and related services in the United States. The company provides sleep therapy equipment, supplies, and related services, such as CPAP and bi-PAP services to individuals suffering from obstructive sleep apnea; medical devices and supplies, including continuous glucose monitors and insulin pumps to patients for the treatment of diabetes; HME to patients discharged from acute care and other facilities; oxygen and related chronic therapy services in the home; and other HME devices and supplies on behalf of chronically ill patients with wound care, urological, incontinence, ostomy, and nutritional supply needs. It serves beneficiaries of Medicare, Medicaid, and commercial insurance payors. AdaptHealth Corp. is headquartered in Plymouth Meeting, Pennsylvania.","Frencken Group Limited, an investment holding company, provides original design, original equipment, and diversified integrated manufacturing solutions worldwide. It operates in two segments, Mechatronics and Integrated Manufacturing Services (IMS). The Mechatronics segment designs, develops, and produces precision-engineered systems and machines, electromechanical assemblies, and high precision parts and components for original equipment manufacturers in the healthcare, analytical and life sciences, semiconductor, and industrial automation markets. It also offers value engineering, prototyping, program machining components and sheet metal parts manufacturing, and modular and equipment system assembly, integration, testing, and commissioning; assembly, testing, designs, engineers, and manufactures mechatronic modules, products, and systems; and research, development, and engineering services. The IMS segment provides integrated contract design and manufacturing services to the automotive, and consumer and industrial electronics industries. This segment design, engineers, manufactures, and sells filters; manufactures mold and die, plastic products, and component sub-assembly; injection mold making and injection molding; manufactures and distributes plastic products; and designs and trades in micro-mechanical product components for automotive industry. The company also engages in the property holding activities; and provision of vacuum coating, thermal treatment, and other related services for plastic component. Frencken Group Limited was founded in 1995 and is based in George Town, Malaysia.","Nayax Ltd., a fintech company, operates system and payment platform worldwide. The company offers VPOS TOUCH that provides contactless and contact payment options; VPOS FUSION, a cashless payment card reader; ONYX, a contactless card reader and telemetry device; AMIT 3.0, a M2M vending telemetry solution; NOVA 156, a points of sale(POS)-handheld smart POS terminal; NOVA 125,a combined dual interface product with a printer and a barcode scanner; NOVA 55, an android-based that enables clearing payments using swipe, contactless, and contact payment methods, as well as accepting alternative payment methods, such as digital wallets and tap on pay; and NOVA 45 and NOVA 40, a handheld mini smart terminals for attended POS. It also provides electric vehicle charging stations; and Monyx Wallet, a digital wallet app installed on the consumer's mobile phone that enables cashless payments using only the mobile phone. In addition, the company provides cashless payments systems; telemetry services, including remote management, monitoring, and control of the unattended POS and service; closed-circuit prepaid card solutions; and management software for unattended machines. Further, it operates marketing, loyalty, and consumer engagement platform. The company sells its products directly, as well as through resellers and distributors. It serves various verticals, including snacks and drinks automatic vending machines, coffee machines, kiddie and amusement rides, massage chairs, laundromats, machines for selling non-prescription drugs, car wash, parking, tourist, fueling, and ticket machines, as well as kiosks, public restrooms, photo booth, donations, AIR/VAC, and ice cream vending machines. The company was incorporated in 2005 and is based in Herzliya, Israel.","Bloom Energy Corporation designs, manufactures, sells, and installs solid-oxide fuel cell systems for on-site power generation in the United States and internationally. The company offers Bloom Energy Server, a power generation platform that converts fuel, such as natural gas, biogas, hydrogen, or a blend of these fuels, into electricity through an electrochemical process without combustion. It serves data centers, hospitals, healthcare manufacturing facilities, biotechnology facilities, grocery stores, hardware stores, banks, telecom facilities and other critical infrastructure applications. The company was formerly known as Ion America Corp. and changed its name to Bloom Energy Corporation in September 2006. Bloom Energy Corporation was incorporated in 2001 and is headquartered in San Jose, California.","EQT Corporation operates as a natural gas production company in the United States. The company produces natural gas, natural gas liquids (NGLs), including ethane, propane, isobutane, butane, and natural gasoline. As of December 31, 2021, it had 25.0 trillion cubic feet of proved natural gas, NGLs, and crude oil reserves across approximately 2.0 million gross acres, including 1.7 million gross acres in the Marcellus play. The company was founded in 1878 and is headquartered in Pittsburgh, Pennsylvania.","NovoCure Limited, an oncology company, engages in the development, manufacture, and commercialization of tumor treating fields (TTFields) devices for the treatment of solid tumor cancers in the United States, Europe, the Middle East, Africa, Japan, and Greater China. Its TTFields devices include Optune for the treatment of glioblastoma; and Optune Lua for the treatment of malignant pleural mesothelioma. The company also has ongoing or completed clinical trials investigating TTFields in brain metastases, gastric cancer, glioblastoma, liver cancer, non-small cell lung cancer, pancreatic cancer, and ovarian cancer. NovoCure Limited was incorporated in 2000 and is headquartered in Saint Helier, Jersey.","Aavas Financiers Limited provides housing loans to customers belonging to low- and middle-income self-employed customers in semi-urban and rural areas in India. It offers home loans for flats, houses, and bungalows, as well as resale properties; land purchase and construction loans, including finance for self-construction of residential house; and home improvement loans, which include loans for tiling or flooring, plaster, painting, etc. The company also provides home equity loans; and micro, small, and medium enterprise loans for business expansion, purchase of equipment, working capital, etc., as well as home loan balance transfer and emergency credit line guarantee scheme products. As of March 31, 2022, it operated through 314 branches covering in 13 states, including Rajasthan, Maharashtra, Gujarat, Madhya Pradesh, Haryana, Uttar Pradesh, Chhattisgarh, Delhi, Punjab, Uttarakhand, Himachal Pradesh, Karnataka, and Odisha. The company was formerly known as AU Housing Finance Limited and changed its name to Aavas Financiers Limited in February 2017. Aavas Financiers Limited was incorporated in 2011 and is based in Jaipur, India.","Tialis Essential IT PLC, through its subsidiaries, provides network, cloud, and IT managed services to public and private companies in the United Kingdom. Its cloud and hosting services include co-location, private, public, and hybrid cloud, DR and business continuity, and cloud migration; network and connectivity service includes cloud connectivity, multi-protocol label switching, local and wide area network, and distributed denial of service protection services; collaboration services comprise hosted telephony and unified communication; managed services include remote infrastructure management, tech bars and on-site resources, field and smart hands, threat protection, and professional services; and device management services comprise procurement, configuration and integration, deployment, management, and retirement services. The company was formerly known as IDE Group Holdings plc and changed its name to Tialis Essential IT PLC in November 2022. Tialis Essential IT PLC was founded in 2005 and is based in Edinburgh, the United Kingdom."],"shape":[50],"dtype":"object","order":"little"}],["ceo",{"type":"ndarray","array":["Mr. Jimmy  Irawan","Mr. Andrew Fana Bambaphansi Mthembu","Mr. Hengky  Wijaya","Mr. Narayan  Gangadhar","Mr. Supachai  Chaisupat","Mr. Michael J. Ferrantino Jr.","Mr. Bob R. Simpson","Sang Mok  Lee","Ms. Cristina Anne Betts","Mr. Mark Andrew Radcliffe","Mr. Richard L. Pearce Jr., P.E.","Mr. Welly  Thomas","Mr. Athanasios  Feidakis","Mr. Magnus  Larsson","Mr. Brodie A. Sutherland BSc (Geol), MAuslMM, MSEG, P.Geo.","Mr. Olivier  Rabiller","Ms. Jesvin  Kaur","Mr. Hyun Chul  Park","Mr. Badrinarayanan  Kothandaraman","Mr. Sean Edward Wade M.A.","Mr. Euan  Shirlaw","Mr. Guilherme Segalla De Mello","Mr. Isaac  Dabah","Mr. Olusegun  Lawson BSc, MBA","Mr. James A. Brock","Mr. Gilad  Yavetz","Mr. Kandarp  Patel","Mr. Ajay Kumar Bansal","Ms. Yu-Bei  Wang","Mr. Martin  Schwartz","Mr. Phillip  Williams (Commerce), B.Com., B.Comm. CFA, C.F.A., CFA","Mr. Scott Eric Melbye","Mr. Justin  Nuich M.B.A.","Mr. Rubem Roberto Ribeiro","Mr. Ken  Gray P.Eng.","Mr. Patrice  Lucas","Mr. Dale Robert Henderson B Eng (Civil)","Mr. Martin  Legault","Mr. Sachinderpalsingh Jitendrasingh Bhinder","Mr. James  Kruger","Ms. Mei-Hung  Chang","Mr. Andreas F. J. Obereder","Mr. Richard Alan Barasch","Mr. Mohamad Anwar Au","Mr. Yair  Nechmad","Dr. K. R. Sridhar Ph.D.","Mr. Toby Z. Rice","Mr. Asaf  Danziger","Mr. Sachinderpalsingh Jitendrasingh
